import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

function Navbar(){
    return(
        <div>
        <Form inline>
            <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
                <Input placeholder="Search Images"></Input>
            </FormGroup>
        </Form>
        </div>
    );
}

export default Navbar
